import React from "react";
import logo from "../assets/metalComp.png";

function navbar() {
  return (
    <div className = "navbar">
      <div className = "leftSide">
        <img src={logo} />
      </div>
      <div className = "rightSide"></div>
    </div>
  )
}

export default navbar
